//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "../Interface/IAuctionData.sol";

contract AuctionData is IAuctionData {
    // ---------------   Dao Address  ------------------------
    address override public router;

    // ---------------    manage    ----------------------
    bool override public initializer;

    // ---------------    auction     ---------------------
    uint256 override public entireVaultPrice;

    uint256 override public auctionLength;

    uint256 override public auctionEnd; 

    uint256 override public livePrice;

    address payable override public winning;
}

